import React from "react";

const DetailJob = (props) => {
  const { params } = props.match;

  return (
    <>
      <h3> {params.position}</h3>
      <span>{params.company}</span>
      <span> {params.location}</span>

      <div>
        <b>Parameter 2: </b>
      </div>
      <div>
        <b>Parameter 2: </b>
        {params.description}
      </div>
    </>
  );
};

export default DetailJob;
